						testMesh.rotationY += 0.3;
						testMesh.rotationZ += 0.3

					testMesh.rotationY = Math.random() * 360;
					testMesh.rotationZ = Math.random() * 360;
					tScene.addChild(testMesh)
				}
			};
			makeModel(this);
		} else {
			console.log('초기화 실패!')
		}
	});
	testUI = function (redGL, tScene) {
		var gui = new baseTestUI(redGL);
		gui.initRedGL();
		var testData = {
			state: testMaterial.program.key
		};
		var t0 = gui['gui'].addFolder('autoProgramTest');
		t0.autoPlace = false;
		var tList = [];
		for (var k in testMaterial._programList['basic']) {
			if (k.indexOf('fog') > -1 || k.indexOf('sprite3D') > -1) continue;
			tList.push(testMaterial._programList['basic'][k]['key'])
		}
		tList.sort();
		t0.add(tScene, 'useFog', true, false);
		t0.add(testData, 'state', tList).onChange(function (v) {
			v = v.split('_');
			testMaterial.diffuseTexture = null;
			testMaterial.normalTexture = null;
			testMaterial.displacementTexture = null;
			testMaterial.specularTexture = null;
			testMaterial.emissiveTexture = null;
			testMaterial.useFlatMode = false
			testMaterial.usePreMultiply = false
			v.forEach(function (k) {
				if (k == 'useFlatMode' || k == 'usePreMultiply') testMaterial[k] = true
				else testMaterial[k] = testTextureMap[k]
			});
			console.log(v)
		});
		t0.open()
	}
</script>
